package Database;

import java.util.Date;

public class Cake {
	
	private String CakeID, CakeName, CakeShape;
	private Integer CakePrice, CakeSize;
//	private Date userDOB;
	
	public Cake() {
		// TODO Auto-generated constructor stub
	}

	public String getCakeID() {
		return CakeID;
	}

	public void setCakeID(String cakeID) {
		CakeID = cakeID;
	}

	public String getCakeName() {
		return CakeName;
	}

	public void setCakeName(String cakeName) {
		CakeName = cakeName;
	}

	public String getCakeShape() {
		return CakeShape;
	}

	public void setCakeShape(String cakeShape) {
		CakeShape = cakeShape;
	}

	public Integer getCakePrice() {
		return CakePrice;
	}

	public void setCakePrice(Integer cakePrice) {
		CakePrice = cakePrice;
	}

	public Integer getCakeSize() {
		return CakeSize;
	}

	public void setCakeSize(Integer cakeSize) {
		CakeSize = cakeSize;
	}
	
	

}
